export function add42(a: number, b: number): number {
  return a + b;
}

export function subtract42(a: number, b: number): number {
  return a - b;
}

export function multiply42(a: number, b: number): number {
  return a * b;
}

export function divide42(a: number, b: number): number {
  return a / b;
}
